import React, { Component } from 'react'

class Visit extends Component {
	// This will loop through the records adding them to the eventually outputted output array
	getRecords = () => {
		let output = [];
		this.props.visitRecord.records.forEach((record,index)=>{
			if(record.type==='visit'){
				output.push(<div key={'visit'+index} className="activity visit">{record.activity}</div>)
			}else{
				output.push(<div key={'violation'+index} className="activity violation"><span className={'wac-code'}><a href={'http://apps.leg.wa.gov/wac/default.aspx?cite='+record.wac_code.replace(/\(.+\)/,'')} target="_blank" rel="noopener noreferrer">{record.wac_code}</a></span>{record.violation_type}<i>{record.penalty_type}</i></div>)
			}
		})
		return output;
	}

	// If the extra lic column needs to be shown then do it, otherwise we can pass
	getLicCol = () => {
		if(this.props.showLic === false){
			return null
		}else{
			return (<td className="lic-num">{this.props.license}</td>)
		}
	}

	render(){
		return (<tr key={this.props.visitRecord.index} className={(this.props.visitRecord.hasViolation?'violation':'')}>
			<td xs="auto" className={'date'}>{this.props.visitRecord.date}</td>
			{this.getLicCol()}
			<td className={'details'}>{this.getRecords()}</td>
		</tr>)
	}
}

export default Visit;
